'#PLUGIN_FILES#ir-all.js'))
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'FUNCTION MAP_RENDER(P_REGION              IN APEX_PLUGIN.T_REGION,',
'                    P_PLUGIN              IN APEX_PLUGIN.T_PLUGIN,',
'                    P_IS_PRINTER_FRIENDLY IN BOOLEAN)',
'  RETURN APEX_PLUGIN.T_REGION_RENDER_RESULT IS',
'  V_HTML CLOB;',
'  V_STMT VARCHAR2(32767);',
'  V_DATA VARCHAR2(32767);',
'  TYPE CUR_TYPE IS REF CURSOR;',
'  L_CUR CUR_TYPE;',
'  TYPE PROV_REC IS RECORD(',
'    NAME  VARCHAR2(50),',
'    VALUE NUMBER);',
'  L_PROVINCES PROV_REC;',
'',
'  V_TITLE                         APEX_APPL_PLUGINS.ATTRIBUTE_01%TYPE := P_REGION.ATTRIBUTE_01; --',
'  V_SUB_TITLE                     APEX_APPL_PLUGINS.ATTRIBUTE_02%TYPE := P_REGION.ATTRIBUTE_02; --',
'  V_MAP_NAVIGATION                APEX_APPL_PLUGINS.ATTRIBUTE_03%TYPE := P_REGION.ATTRIBUTE_03; --',
'  V_SERIES_LABEL                  APEX_APPL_PLUGINS.ATTRIBUTE_04%TYPE := P_REGION.ATTRIBUTE_04; --',
'  V_SERIES_HOVER_COLOR            APEX_APPL_PLUGINS.ATTRIBUTE_05%TYPE := P_REGION.ATTRIBUTE_05; --',
'  V_PROVINCE_LABELS               APEX_APPL_PLUGINS.ATTRIBUTE_06%TYPE := P_REGION.ATTRIBUTE_06; --',
'  V_TOOLTIP_VALUE_SUFFIX          APEX_APPL_PLUGINS.ATTRIBUTE_07%TYPE := P_REGION.ATTRIBUTE_07; --',
'  V_LEGEND_TITLE                  APEX_APPL_PLUGINS.ATTRIBUTE_08%TYPE := P_REGION.ATTRIBUTE_08; --',
'  V_LEGEND_ALIGN                  APEX_APPL_PLUGINS.ATTRIBUTE_09%TYPE := P_REGION.ATTRIBUTE_09; --',
'  V_LEGEND_VERTICAL_ALIGN         APEX_APPL_PLUGINS.ATTRIBUTE_10%TYPE := P_REGION.ATTRIBUTE_10; --',
'  V_LEGEND_FLOATING               APEX_APPL_PLUGINS.ATTRIBUTE_11%TYPE := P_REGION.ATTRIBUTE_11; --',
'  V_LEGEND_LAYOUT                 APEX_APPL_PLUGINS.ATTRIBUTE_12%TYPE := P_REGION.ATTRIBUTE_12; --',
'  V_COLOR_AXIS_RANGE              APEX_APPL_PLUGINS.ATTRIBUTE_13%TYPE := P_REGION.ATTRIBUTE_13;',
'  V_AXIS_MIN_VALUE                APEX_APPL_PLUGINS.ATTRIBUTE_14%TYPE := P_REGION.ATTRIBUTE_14;',
'  V_AXIS_MAX_VALUE                APEX_APPL_PLUGINS.ATTRIBUTE_15%TYPE := P_REGION.ATTRIBUTE_15;',
'  V_AXIS_RANGE_VALUES             VARCHAR2(500) := P_REGION.ATTRIBUTE_16;',
'  V_SERIES_SHADOW                 VARCHAR2(10) := P_REGION.ATTRIBUTE_17; --',
'  V_MAP_NAVIGATION_ALIGN          VARCHAR2(100) := P_REGION.ATTRIBUTE_18;',
'  V_MAP_NAVIGATION_VERTICAL_ALIGN VARCHAR2(100) := P_REGION.ATTRIBUTE_19;',
'  V_AXIS_MIN_COLOR          VARCHAR2(100) := P_REGION.ATTRIBUTE_20;',
'  V_AXIS_MAX_COLOR          VARCHAR2(100) := P_REGION.ATTRIBUTE_21;',
'  V_COLOR_AXIS                    VARCHAR2(1000);',
'  L_AXIS                          VARCHAR2(1000);',
'BEGIN',
'  -- GET SQL QUERY FROM SQL SOURCE',
'  V_STMT := P_REGION.SOURCE;',
'',
'  OPEN L_CUR FOR V_STMT;',
'  LOOP',
'    FETCH L_CUR',
'      INTO L_PROVINCES;',
'    EXIT WHEN L_CUR%NOTFOUND OR L_CUR%NOTFOUND IS NULL;',
'    IF V_DATA IS NOT NULL THEN',
'      V_DATA := V_DATA || '','';',
'    END IF;',
'    V_DATA := V_DATA || ''['''''' || L_PROVINCES.NAME || '''''', '' ||',
'              L_PROVINCES.VALUE || '']'';',
'  ',
'  END LOOP;',
'',
'  IF V_MAP_NAVIGATION = ''Y'' THEN',
'    V_MAP_NAVIGATION := ''true'';',
'  ELSE',
'    V_MAP_NAVIGATION := ''false'';',
'  END IF;',
'',
'  IF V_LEGEND_FLOATING = ''Y'' THEN',
'    V_LEGEND_FLOATING := ''true'';',
'  ELSE',
'    V_LEGEND_FLOATING := ''false'';',
'  END IF;',
'',
'  IF V_PROVINCE_LABELS = ''Y'' THEN',
'    V_PROVINCE_LABELS := ''true'';',
'  ELSE',
'    V_PROVINCE_LABELS := ''false'';',
'  END IF;',
'',
'  IF V_SERIES_SHADOW = ''Y'' THEN',
'    V_SERIES_SHADOW := ''true'';',
'  ELSE',
'    V_SERIES_SHADOW := ''false'';',
'  END IF;',
'',
'  IF V_COLOR_AXIS_RANGE = ''Y'' THEN',
'    V_COLOR_AXIS := ''dataClasses: ['';',
'    FOR I IN (SELECT REGEXP_SUBSTR(V_AXIS_RANGE_VALUES, ''[^;]+'', 1, LEVEL) VAL',
'                FROM DUAL',
'              CONNECT BY REGEXP_SUBSTR(V_AXIS_RANGE_VALUES,',
'                                       ''[^;]+'',',
'                                       1,',
'                                       LEVEL) IS NOT NULL) LOOP',
'    ',
'      IF V_COLOR_AXIS != ''dataClasses: ['' THEN',
'        V_COLOR_AXIS := V_COLOR_AXIS || '','';',
'      END IF;',
'    ',
'      V_COLOR_AXIS := V_COLOR_AXIS || ''{'';',
'      IF LENGTH(I.VAL) = 0 THEN',
'        CONTINUE;',
'      END IF;',
'      IF INSTR(I.VAL, '':'') = 0 THEN',
'        L_AXIS := ''from: '' || I.VAL || '', to: '' || I.VAL;',
'      ELSE',
'        IF SUBSTR(I.VAL, 1, 1) = '':'' THEN',
'          L_AXIS := NULL;',
'        ELSE',
'          L_AXIS := '' from: '' || SUBSTR(I.VAL, 1, INSTR(I.VAL, '':'') - 1);',
'        END IF;',
'      ',
'        IF SUBSTR(I.VAL, -1) = '':'' THEN',
'          NULL;',
'        ELSE',
'          IF L_AXIS IS NOT NULL THEN',
'            L_AXIS := L_AXIS || '','';',
'          END IF;',
'          L_AXIS := L_AXIS || '' to: '' ||',
'                    SUBSTR(I.VAL, INSTR(I.VAL, '':'') + 1);',
'        END IF;',
'      END IF;',
'    ',
'      V_COLOR_AXIS := V_COLOR_AXIS || L_AXIS || ''}'';',
'    ',
'    END LOOP;',
'    V_COLOR_AXIS := V_COLOR_AXIS || '']'';',
'  ELSE',
'    V_COLOR_AXIS := ''min: '' || NVL(V_AXIS_MIN_VALUE, 0);',
'    IF V_AXIS_MAX_VALUE IS NOT NULL AND V_AXIS_MAX_VALUE > V_AXIS_MIN_VALUE THEN',
'      V_COLOR_AXIS := V_COLOR_AXIS || '', max:'' || V_AXIS_MAX_VALUE;',
'    END IF;',
'  END IF;',
'',
'  IF V_AXIS_MIN_COLOR IS NOT NULL THEN',
'    V_AXIS_MIN_COLOR := ''minColor: '''''' || V_AXIS_MIN_COLOR || '''''','';',
'  END IF;',
'  IF V_AXIS_MAX_COLOR IS NOT NULL THEN',
'    V_AXIS_MAX_COLOR := ''maxColor: '''''' || V_AXIS_MAX_COLOR || '''''','';',
'  END IF;',
'',
'  APEX_JAVASCRIPT.ADD_INLINE_CODE(''var data = [ '' || V_DATA || '' ];',
'',
'// Create the chart',
'Highcharts.mapChart('''''' || P_REGION.NAME ||',
'                                  '''''', {',
'    chart: {',
'        map: ''''countries/ir/ir-all''''',
'    },',
'',
'    title: {',
'        text: '''''' || V_TITLE || ''''''',
'    },',
'',
'    subtitle: {',
'        text: '''''' || V_SUB_TITLE || ''''''',
'    },',
'',
'    mapNavigation: {',
'        enabled: '' || V_MAP_NAVIGATION || '',',
'        buttonOptions: {',
'            align: '''''' ||',
'                                  V_MAP_NAVIGATION_ALIGN || '''''',',
'            verticalAlign: '''''' ||',
'                                  V_MAP_NAVIGATION_VERTICAL_ALIGN || ''''''',
'        }',
'    },',
'',
'    legend: {',
'            title: {',
'                text: '''''' ||',
'                                  V_LEGEND_TITLE || '''''',',
'                style: {',
'                    color: ( // theme',
'                        Highcharts.defaultOptions &&',
'                        Highcharts.defaultOptions.legend &&',
'                        Highcharts.defaultOptions.legend.title &&',
'                        Highcharts.defaultOptions.legend.title.style &&',
'                        Highcharts.defaultOptions.legend.title.style.color',
'                    ) || ''''black''''',
'                }',
'            },',
'            align: '''''' || V_LEGEND_ALIGN || '''''',',
'            verticalAlign: '''''' ||',
'                                  V_LEGEND_VERTICAL_ALIGN || '''''',',
'            floating: '' ||',
'                                  V_LEGEND_FLOATING || '',',
'            layout: '''''' ||',
'                                  V_LEGEND_LAYOUT || '''''',',
'            valueDecimals: 0,',
'            backgroundColor: ( // theme',
'                Highcharts.defaultOptions &&',
'                Highcharts.defaultOptions.legend &&',
'                Highcharts.defaultOptions.legend.backgroundColor',
'            ) || ''''rgba(255, 255, 255, 0.85)'''',',
'            symbolRadius: 0,',
'            symbolHeight: 14',
'        },',
'',
'    colorAxis: {',
'        '' || V_AXIS_MIN_COLOR || ',
'        V_AXIS_MAX_COLOR ||',
'        V_COLOR_AXIS || ''',
'    },',
'',
'    series: [{',
'                data: data,',
'                name: '''''' ||',
'                                  V_SERIES_LABEL || '''''',',
'                states: {',
'                    hover: {',
'                        color: '''''' ||',
'                                  V_SERIES_HOVER_COLOR || ''''''',
'                    }',
'                },',
'                dataLabels: {',
'                    enabled: '' ||',
'                                  V_PROVINCE_LABELS || '',',
'                    format: ''''{point.name}''''',
'                },',
'                tooltip: {',
'                valueSuffix: '''' '' ||',
'                                  V_TOOLTIP_VALUE_SUFFIX || ''''''',
'                },',
'                shadow: '' ||',
'                                  V_SERIES_SHADOW || ''',
'            }]',
'        });'');',
'',
'  V_HTML := ''<div id="'' || P_REGION.NAME || ''"></div>'';',
'  SYS.HTP.P(V_HTML);',
'',
'  RETURN NULL;',
'EXCEPTION',
'  WHEN NO_DATA_FOUND THEN',
'    SYS.HTP.P(''NO DATA FOUND'');',
'    RETURN NULL;',
'  WHEN OTHERS THEN',
'    SYS.HTP.P(SQLERRM);',
'    RETURN NULL;',
'END;',
''))
,p_api_version=>2
